import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';

const arr = [
  {
    name: 'Hoang',
    desc: 'I love all things design!'
  },
  {
    name: 'Priya',
    desc: 'Looking for a coding buddy :)'
  },
  {
    name: 'Alex',
    desc: 'Hello :)'
  }
]

const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>my matches</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 1</IonTitle>
          </IonToolbar>
        </IonHeader>
        <ExploreContainer name="Tab 1 page" />
        <IonList>
          <IonItem>

          </IonItem>
        </IonList>

      </IonContent>
    </IonPage>
  );
};

export default Tab1;
